column3:
Raw scores were converted to T scores for gender and age based on the Conners-3 Manual look up tables. Common characteristics of high scorers in this category: high activity levels, may be restless and/or impulsive; may have difficulty being quite; may interrupt others or talk too much; may be easily excited. 
Interpretive Guidelines for T Scores and Percentiles: 
Above 70 – 98th+ percentile - Very Elevated (many more concerns than are typically reported); 
65-69 – 93-97th percentile - Elevated (more concerns than are typically reported); 
60-64 – 84-92nd percentile - High Average (slightly more concerns than are typically reported; requires careful consideration and clinical judgment, as this range is the borderline between typical and a typical levels of concern); 
40-59 – 16-83rd percentile – Average (typical levels of concern); 
<40 - <16th percentile – Low (fewer concerns than are typically reported)

